	add("spider", "{\"term\":\"spider\", \"etymology\":{\"influencers\":[], \"languages\":[\"old english (ca. 450-1100)\", \"Danish\", \"German\", \"English\", \"middle english (1100-1500)\", \"West Frisian\", \"Dutch\", \"scots\", \"Swedish\"], \"text\":\"From Middle english (1100-1500) {{m|enm|spithre}}, from Old english (ca. 450-1100) {{m|ang|spīder}}, {{m|ang|spīþra||spider}}, from Proto-germanic {{m|gem-pro|*spinþrô||spider\u0026quot;, literally, \u0026quot;spinner}}, from Proto-indo-european {{m|ine-pro|*(s)pend-}}, {{m|ine-pro|*(s)pen-||to pull, stretch, spin}}. Cognate with Scots {{m|sco|spider||spider}}, West frisian {{m|fy|spin||spider}}, Dutch {{m|nl|spin||spider}}, German {{m|de|Spinne||spider}}, Danish {{m|da|spinder||spinner, spider}}, Swedish {{m|sv|spindel||spider}}. More at {{l|en|spin}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Any of various eight-legged, predatory arthropods, of the order \u0027Araneae\u0027, most of which spin webs to catch prey\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A program which follows links on the World Wide Web in order to gather information\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A float (drink) made by mixing ice-cream and a soda or fizzy drink (such as lemonade\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"2002\u0027\u0027, Katharine Gasparini, \u0027Cranberry and vanilla ice cream \u0027\u0027spider\u0027\u0027\u0027, recipe in \u0027Cool Food\u0027, spiders%22\u0026amp;hl\u003den\u0026amp;ei\u003dfJvPTrKyCMWUiQeFndDCDg\u0026amp;sa\u003dX\u0026amp;oi\u003dbook_result\u0026amp;ct\u003dresult\u0026amp;redir_esc\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"spiders%22\u0026amp;f\u003dfalse page 339\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"A spindly person\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"A man who persistently approaches or accosts a woman in a public social setting, particularly in a bar\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"A stick with a convex arch-shaped notched head used to support the cue when the cue ball is out of reach at normal extension; a bridge\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"A cast-iron frying pan with three legs, once common in open-hearth cookery\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"1846\u0027\u0027, Mary Hooker Cornelius, \u0027The Young Housekeeper\u0027s Friend\u0027, [http://catalog.hathitrust.org/Record/008611479 page\u0026amp;nbsp;146], recipe\u0026amp;nbsp;28 “To fry salt pork”\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"Cut slices and lay them in cold water in the \u0027\u0027spider\u0027\u0027; boil them up two or three minutes, then pour off the water and set the \u0027\u0027spider\u0027\u0027 again on the coals and brown the slices on each side\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"2005\u0027\u0027, Marty Davidson, \u0027Grandma Grace\u0027s Southern Favorites\u0027, recipe for “strawberry coconuts”, Rutledge Hill Press, ISBN 1-4016-0219-3, page\u0026amp;nbsp;193\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"In \u0027\u0027spider\u0027\u0027 pan or deep skillet set over hot coals, quickly fry a few at a time in deep lard until brown\", \"priority\":13},{\"upperType\":\"NOUN\", \"text\":\"2008\u0027\u0027, Corona Club (San Francisco, California), \u0027Corona Club Cook Book\u0027, spiders%22\u0026amp;hl\u003den\u0026amp;ei\u003dzKLPTqyxMYuImQX7vJihDQ\u0026amp;sa\u003dX\u0026amp;oi\u003dbook_result\u0026amp;ct\u003dresult\u0026amp;redir_esc\", \"priority\":14},{\"upperType\":\"NOUN\", \"text\":\"spiders%22\u0026amp;f\u003dfalse page 202\", \"priority\":15},{\"upperType\":\"NOUN\", \"text\":\"Melt ½ the dry sugar in the \u0027\u0027spider\u0027\u0027, stirring with knife until all is melted\", \"priority\":16},{\"upperType\":\"NOUN\", \"text\":\"Implement for moving food in and out of hot oil for deep frying, with a circular metal mesh attached to a long handle\", \"priority\":17},{\"upperType\":\"NOUN\", \"text\":\"1996\u0027\u0027, City and Guilds of London Institute, \u0027Food preparation and cooking. Cookery units. Student guide.\u0027, Stanley Thornes, ISBN 0-7487-2566-0, unit 2ND5, element\u0026amp;nbsp;2, page\u0026amp;nbsp;157\", \"priority\":18},{\"upperType\":\"NOUN\", \"text\":\"If you are deep-frying your falafel, use a \u0027\u0027spider\u0027\u0027 or basket to place them gently into the hot oil, which should be preheated to a temperature of 175°C (330°F\", \"priority\":19},{\"upperType\":\"NOUN\", \"text\":\"2008\u0027\u0027, Anna Kasabian and David Kasabian, \u0027The Wild Fish Cookbook\u0027, Creative Publishing International, ISBN 1-58923-317-4, page\u0026amp;nbsp;84\", \"priority\":20},{\"upperType\":\"NOUN\", \"text\":\"Consider investing in a frying basket or a \u0027\u0027spider\u0027\u0027 for small amounts of fish. A \u0027\u0027spider\u0027\u0027 looks like a metal web and has a long handle and can lower and raise fish from the hot oil\", \"priority\":21},{\"upperType\":\"NOUN\", \"text\":\"A part of a crank, to which the chainrings are attache\", \"priority\":22},{\"upperType\":\"NOUN\", \"text\":\"Heroin (street drug\", \"priority\":23},{\"upperType\":\"NOUN\", \"text\":\"Part of a resonator instrument that transmits string vibrations from the bridge to a resonator cone at multiple points\", \"priority\":24},{\"upperType\":\"NOUN\", \"text\":\"A skeleton or frame with radiating arms or members, often connected by crosspieces, such as a casting forming the hub and spokes to which the rim of a fly wheel or large gear is bolted; the body of a piston head; or a frame for strengthening a core or mould for a casting\", \"priority\":25}]}, \"synonyms\":{}}");

